package com.leetcodetest.初级算法.字符串.字符串中的第一个唯一字符;

class Solution {
    public int firstUniqChar(String s) {
        // 0不存在 1存在 2重复
        int[] flagIndex = new int[26];
        // 第一次出现的index
        int[] chars = new int[26];
        for (int i = 0; i < s.length(); i++) {
            char target = s.charAt(i);
            int index = (int)target - 97;
            if (flagIndex[index] == 0) {
                flagIndex[index] = 1;
                chars[index] = i;
            } else {
                flagIndex[index] = 2;
            }
        }

        int res = -1;

        for (int i = 0; i < flagIndex.length; i++) {
            if (flagIndex[i] == 1) {
                if (res == -1) {
                    res = chars[i];
                } else {
                    res = chars[i] < res ? chars[i] : res;
                }
            }
        }

        return res;
    }
}

class Test {
    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.firstUniqChar("leetcode"));
        System.out.println(solution.firstUniqChar(""));
    }
}